import "../styles/Product.css";
import celularjpl from "../assets/19604510_1.jpeg";

function Product() {
  return (
    <section>
      <div className="contentProduct">
        <img src={celularjpl} alt="imgproduct" />
        <div className="content">
        <h1>Acaba va el precio</h1>
        <p>Descripcion del producto</p>
        </div>

      </div>
    </section>
  );
}

export default Product;
